import React from 'react';

const SearchBar = ({ onSearch, searchTerm, setSearchTerm }) => {
    return (
        <div>
            <input
                type="text"
                placeholder="Search by title..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
            />
            <button onClick={() => onSearch()}>Search</button>
        </div>
    );
};
export default SearchBar;
